import Contact from "./Contact";
import contactsArray from "../data";

const contact = contactsArray.map((elem, i) => {
  return <Contact key={i} {...elem} />;
});

export default function List(props) {
  console.log({ props });
  return (
    <section className="contacts" style={{ padding: 10 }}>
      {contact}
    </section>
  );
}
